#define LD LBRA

void yyinsert_comma_in_input(const int lastToken)
{//HAZARD: check for '{' and '.'
int count, current, next;

if (lastToken==END)
{
    unput(';');
	return;
}

if (!(BracketDelimiter == LBRA || BracketDelimiter == LD))
return;
for (count = 1; ; count++)
{
current = yyinput();
if (current != ' ' && current != '\t')
break;
}
if (current == ',' || current == ';' || current == ']' ||
current == '*' || current == '^' || current == ':' ||
current == '<' || current == '>' || current == '=' ||
current == '&' || current == '|' ||
current == '/' || current == '\\' ||
current == '\n' || current == '\r' || current == '\f' ||
current == '%' || current == '.' || //HSKOST added '.' for  fields
(current == '\'' && count == 1))
{
unput(current);
return;
}
if ((current == '(' ||current == '{' || current == '.') &&
(BracketDelimiter == LD ||
(lastToken == IDENT && count == 1)))
{
unput(current);
return;
}
if (isalpha(current) &&
(lastToken == NUMBER || lastToken == NUMBER_IM) && count == 1)
{
unput(current);
return;
}
next = yyinput();
++count;
if (current == '.' &&
(next == '\'' || next == '*' || next == '^' ||
next == '/' || next == '\\' || next == '.'))
{
unput(next);
unput('.');
if (next == '\'' && count > 2)
unput(' ');
return;
}
if (current == '~' && next == '=')
{
unput('=');
unput('~');
return;
}
if (current == '+' || current == '-')
{
if (count == 2 || next == ' ' || next == '\t')
{
unput(next);
unput(current);
return;
}
}
unput(next);
unput(current);
unput(',');
}
